    return {
        addReview: addReview,
        create: create,
        getAll: getAll,
        getById: getById,
        getByUserId: getByUserId,
        remove: remove
    };

    function addReview(review) {
        var art = getById(review.art.id);
        art.reviews.push({
            user: {
                id: review.user.id,
                username: review.user.username
            },
            rating: review.rating,
            comment: review.comment
        });

        return art;
    }

    function create(art) {
        var art = {
            id: nextId(),
            userId: art.userId,
            title: art.title,
            imageSource: art.img,
            state: art.state,
            squareSetId: art.squareSetId,
            reviews: art.reviews
        }

        arts.push(art);

        return art;
    }

    function remove(id) {
        var removed;

        arts = arts.filter(function (element) {
            if (element.id !== id) {
                return true
            }

            removed = element;
            return false;
        });

        return removed;
    }

    function getAll() {
        return arts;
    }

    function getById(id) {
        for (var i = 0; i < arts.length; i++) {
            if (arts[i].id === id) {
                return arts[i];
            }
        }

        return null;
    }

    function getByUserId(id) {
        return arts.filter(function (value) {
            return value.userId === id
        });
    }

    function nextId() {
        var id = 0;

        for (var i = 0; i < arts.length; i++) {
            if (id < arts[i].id) {
                id = arts[i].id;
            }
        }

        return id + 1;
    }
